import Link from "next/link";

const linkStyle = {
  marginRight: 15
};

Header = styled.h1`
  color: red;
`;

export default function Header() {
  return (
    <div>
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/posts/new">
        <a style={linkStyle}>Create new post</a>
      </Link>
    </div>
  );
}
